import React, { useState, useEffect } from "react";
import axios from "axios";
import TransactionsList from "../TransactionsList";
import PropTypes from "prop-types";

import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";
import Form from "react-bootstrap/Form";

function AddTransactionModal(props) {
  const addTransaction = ({
    drop_off,
    admin,
    phone_num,
    email,
    last_four,
    transactions,
  }) => {
    axios
      .post(`${props.WEMES_URL}users/`, {
        drop_off: drop_off,
        admin: admin,
        phone_num: phone_num,
        last_four: last_four,
        email: email,
        transactions: transactions,
      })
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  };
  // TODO: Lowercase accountData
  const [accountData, setTransactionData] = useState({
    drop_off: "",
    admin: "",
    phone_num: "",
    last_four: "",
    email: "",
    transactions: [],
  });

  const submitTransactionData = (event) => {
    event.preventDefault();
    addTransaction(accountData);
    setTransactionData({
      drop_off: "",
      admin: "",
      phone_num: "",
      last_four: "",
      email: "",
      transactions: [],
    });
  };

  return (
    <Modal
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter">
          Add New Users
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Form size="lg" onSubmit={submitTransactionData}>
          <Form.Group className="mb-3" controlId="formFirstName">
            <Form.Label>First Name</Form.Label>
            <Form.Control
              type="name"
              placeholder="First Name"
              onChange={(event) =>
                setTransactionData({
                  ...accountData,
                  drop_off: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formLastName">
            <Form.Label>Last Name</Form.Label>
            <Form.Control
              type="name"
              placeholder="Last Name"
              onChange={(event) =>
                setTransactionData({
                  ...accountData,
                  admin: event.target.value,
                })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicEmail">
            <Form.Label>Email address</Form.Label>
            <Form.Control
              type="email"
              placeholder="Email"
              onChange={(event) =>
                setTransactionData({ ...accountData, email: event.target.value })
              }
            />
            <Form.Text className="text-muted"></Form.Text>
          </Form.Group>

          <Form.Group className="mb-3" controlId="formPhoneNumber">
            <Form.Label>Phone Number</Form.Label>
            <Form.Control
              type="text"
              name="phone_num"
              placeholder="Phone Number"
              onChange={(event) =>
                setTransactionData({
                  ...accountData,
                  phone_num: event.target.value,
                })
              }
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formLastFour">
            <Form.Label>Last Four</Form.Label>
            <Form.Control
              type="text"
              placeholder="Last Four"
              // disabled
              onChange={(event) =>
                setTransactionData({
                  ...accountData,
                  last_four: event.target.value,
                })
              }
            />
          </Form.Group>
          <Form.Group className="mb-3" controlId="formLastFour">
            <Form.Label>Transactions</Form.Label>
            <Form.Control type="text" placeholder="" disabled />
          </Form.Group>
          {/* <Form.Group className="mb-3" controlId="formBasicCheckbox">
        <Form.Check type="checkbox" value="false" label="Check me out" />
      </Form.Group> */}
          <Button variant="warning" type="submit" onClick={props.onHide}>
            Submit
          </Button>
        </Form>
      </Modal.Body>
    </Modal>
  );
}

const Transactions = ({ WEMES_URL }) => {
  const [transactionData, setTransactionData] = useState([]);
  const [modalShow, setModalShow] = React.useState(false);

  const getTransactions = () => {
    axios
      .get(`${WEMES_URL}transactions/`)
      .then((response) => {
        // console.log(response);
        const newData = response.data.map((transaction) => {
          return {
            id: transaction.id,
            drop_off: transaction.drop_off,
            admin: transaction.admin,
            customer: transaction.customer,
            items: transaction.items,
            description: transaction.description,
          };
        });
        setTransactionData(newData);
      })
      .catch((err) => {
        alert(err);
      });
  };

  useEffect(() => getTransactions(), [transactionData]);

  return (
    <div>
      <h1>Transactions</h1>
      <Button variant="warning" onClick={() => setModalShow(true)}>
        Add Transaction
      </Button>

      <AddTransactionModal
        show={modalShow}
        onHide={() => setModalShow(false)}
        WEMES_URL={WEMES_URL}
      />
      <TransactionsList transactionData={transactionData} />
    </div>
  );
};

Transactions.propTypes = {
  WEMES_URL: PropTypes.string.isRequired,
};

export default Transactions;
